export namespace System
{

	export class DBNull
	{
		protected $id:string = null;
		protected $type:string = "System.DBNull, mscorlib";
	}

    export class Nullable<T> {
        private _value: T;
        get Value(): T {
            return this._value;
        }
        set Value(value: T) {
            this._value = value;
        }
    }

    export class Exception extends Error {
        protected $id:string = null;
		protected $type:string = "System.Exception, mscorlib";
    }
}

export namespace System.Data
{

	export enum ParameterDirection
	{
		Input=1,
		Output=2,
		InputOutput=3,
		ReturnValue=6
	}

	export class DataRow
	{
		[key: string]: any;
	}

	export class DataTable extends Array<DataRow> { }

	/**
	 * @example DataSet example
	 * {
     *  'Table1': [
     *	  {
	 *		'id': 0,
     *		'item': 'item 0'
     *	  },
     *	  {
     *		'id': 1,
     *		'item': 'item 1'
	 *	  }
	 *	 ]
	 * }
	 */
	export class DataSet
	{
		[tableName: string]: DataTable;
	}

	(<any>DataSet).prototype.toJSON = function() {
		const temp = {};
		for (const property in this) {
            if (this.hasOwnProperty(property)) {
                if (!property.endsWith("_Columns")) {
                    this[property].forEach(row => {
                        for (const prop in row) {
                            if (row.hasOwnProperty(prop)) {
                                if (prop === '$id' || prop === '$ref') {
                                    delete row[prop];
                                }
                            }
                        }
                    });
					temp[property] = this[property];
                }
            }
        }

		return JSON.stringify(temp);
	};
}
